import React from 'react';
import classes from './Feed.module.css'
import SingleImage from './SingleImage/SingleImage'
import ShowMore from './ShowMore/ShowMore'

const Feed = ( props ) => {
    return (
        <div className={classes}>
            <SingleImage />
            <ShowMore />
         </div>
    );
}

export default Feed;
